import logo from './logo.svg';
import './App.css';
import Title from './components/title';
import MySidebar from "./components/mySidebar";

function App() {
    return (
        <div className="App">
            <Title/>
            <header className="App-header">
                <MySidebar/>
                <img src={logo} className="App-logo" alt="logo" />
                <p>
                    Hello class!
                </p>
            </header>
        </div>
    );
}

export default App;
